import styled from 'styled-components';
import {
  Colors,
  FontFamilies,
  FontWeights,
  FontSizes,
} from "../../shared/DesignTokens";

export const HeadingTwo = styled.h2`
font-family: ${FontFamilies.PRIMARY};
font-size: ${FontSizes.FOUR};
font-weight: ${FontWeights.EXTRABOLD};
color: ${Colors.PURPLE};

`;
